   "source": [
    "* From the graph there is a negative relationship between Sedentary Minutes and Sleep time\n",
    "* To help improve the sleep pattern of their users, Bellabeat can enhance their app to recommend reducing sedentary time.\n",
    "* We know that we need to support these insights with more data, because correlation between some data doesn’t mean causation. other factors like care for the family, stress at work could possibly be affecting the results."
   ]
