   },
   "source": [
    "* According to CDC research, taking 8,000 steps daily was associated with a 51% lower risk for all-cause mortality (or death from all causes). Taking 12,000 daily steps was associated with a 65% lower risk than taking 4,000 steps. Hence, taking an average of 7638 daily steps is insufficient to gain health benefits. bellabeat can incentivise users to encourage them to make the 8,000 daily steps recommended for healthy living.\n",
    "\n",
    "* If users want to improve their sleep, Bellabeat should consider using app notifications to help them go to bed.\n",
    "\n",
    "* If the user intends to lose weight, I think controlling their daily calorie consumption is better. Bellabeat can suggest some ideas for low-calorie lunch and dinner.\n",
    "\n",
    "* Most activity happens between 5 pm and 7 pm. I suppose, that people go to some workout after finishing work. Bellabeat can use this time to remind and motivate users to go for a run or walkor some other exercise.\n",
    "\n"
   ]
